import "./App.css";

import { useState, useEffect } from "react";
import { createClient, Session } from "@supabase/supabase-js";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import UserProfile from "./pages/UserProfile";
import EditUserProfile from "./pages/EditUserProfile";
import Login from "./pages/Login";

export const supabase = createClient(
  "https://xytvpdkxrzbiykufavpy.supabase.co",
  "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Inh5dHZwZGt4cnpiaXlrdWZhdnB5Iiwicm9sZSI6ImFub24iLCJpYXQiOjE3NDg2NzAzNDYsImV4cCI6MjA2NDI0NjM0Nn0.l0R2Xpm32XnrZSKTgBNG6yaD8a1F2jXPAD5c9a4hKzY"
);

export default function App() {
  const [session, setSession] = useState<Session | null>(null);

  // This holds user profile data for both viewing and editing
  const [userData, setUserData] = useState({
    name: "",
    username: "",
    bio: "",
    avatarUrl: "/assets/img/default-avatar.png", // fallback avatar
    location: "",
    streak: 0,
    connections: 0,
    interests: [] as string[],
    classes: [] as string[],
  });

  useEffect(() => {
    supabase.auth.getSession().then(({ data: { session } }) => {
      setSession(session);
      // TODO: fetch user profile data here if session exists, then setUserData(...)
    });

    const {
      data: { subscription },
    } = supabase.auth.onAuthStateChange((_event, session) => {
      setSession(session);
      // TODO: fetch user profile data here if session exists, then setUserData(...)
    });

    return () => subscription.unsubscribe();
  }, []);

  // If no session, show login
  if (!session) {
    return <Login />;
  }

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={<UserProfile {...userData} />}
        />
        <Route
          path="/edit-profile"
          element={
            <EditUserProfile
              name={userData.name}
              username={userData.username}
              bio={userData.bio}
              location={userData.location}
              interests={userData.interests}
              classes={userData.classes}
              onSave={(updated) => setUserData((prev) => ({ ...prev, ...updated }))}
            />
          }
        />
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
}
